      _stagephasesinfo = [];
      json['STAGE_PHASES_INFO'].forEach((v) {
        _stagephasesinfo?.add(StagePhasesInfo.fromJson(v));
      });
    }
  }
  num? _lttcode;
  List<Team>? _team;
  List<StagePhasesInfo>? _stagephasesinfo;
