  List<Team>? team,
  List<StagePhasesInfo>? stagephasesinfo,
}) => Tables(  lttcode: lttcode ?? _lttcode,
  team: team ?? _team,
  stagephasesinfo: stagephasesinfo ?? _stagephasesinfo,
);
  num? get lttcode => _lttcode;
  List<Team>? get team => _team;
  List<StagePhasesInfo>? get stagephasesinfo => _stagephasesinfo;

